import React, { Component } from 'react';

import Home from './Home';
import TheFacts from './TheFacts';
import HowToHelp from './HowToHelp';

class AboutOurSite extends Component {
    render() {
        return (
            <div>
                <nav className="navbar navbar-expand-lg">
                    <div className="navbar-brand">Hope in Seattle</div>
                    <ul className="navbar-nav ml-auto">
                        <li className="nav-item"><a href={Home}>Home</a></li>
                        <li className="nav-item active">About Our Site</li>
                        <li className="nav-item"><a href={TheFacts}>The Facts</a></li>
                        <li className="nav-item"><a href={HowToHelp}>How to Help</a></li>
                    </ul>
                </nav>

                <main className="container-fluid">
                    <p>About Our Site</p>
                </main>
            </div>
        );
    }
}

export default AboutOurSite;
